import React from 'react'
import kweisImg from '../../images/kweis.jpeg'
import { 
    ResumeContainer,
    ResumeTitle,
    ResumeBodyContainer 
} from './ResumeElements'

const Resume = () => {
  return (
    <ResumeContainer>
        <ResumeTitle>
            <em>RESUME</em>
        </ResumeTitle>
        <ResumeBodyContainer>
            <ResumeImageContainer>
                <ResumeImage alt="ResumeImage" src={kweisImg} />
                    {/* AboutMeImage alt="AboutMeImage" src={img} /> */}
            </ResumeImageContainer>
        </ResumeBodyContainer>
    </ResumeContainer>
  )
}

export default Resume
